import {
  Card,
  CardActions,
  CardContent,
  CardMedia,
  Icon,
  Typography,
} from "@mui/material";
import React from "react";
import { ReactComponent as TelevisionIcon } from "../assets/images/television.svg";

export const CustomCard = (props) => {
  const { Info, styles = {}, ...other } = props;
  const { title, Description, image } = Info; // Destructure Info to get the properties

  return (
    <>
      <Card sx={{...styles.card}}>
        <CardContent>
          <Typography sx={{...styles.parag}}>{title}</Typography>
          <Typography>{Description}</Typography>
        </CardContent>
        <CardMedia>{image}</CardMedia>
      </Card>
    </>
  );
};

export default CustomCard;
